INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('0-6485-9746-5', 'Strom is Coming', , '2015-09-09', 'Jane Austen', '\"Storm Is Coming\" is a captivating love story that takes readers on an emotional rollercoaster ride. Set against a backdrop of turbulent weather, the book follows the journey of two star-crossed lovers, navigating the tempestuous winds of life and love. With powerful imagery and evocative prose, the author creates a vivid atmosphere that mirrors the intensity of the characters\' emotions. The stormy weather becomes a metaphor for the challenges they face, adding depth and complexity to their relationship. The chemistry between the protagonists is electric, and their passionate love is beautifully portrayed. Throughout the book, readers are kept on the edge of their seats, wondering if love will triumph over the adversities that threaten to tear them apart. \"Storm Is Coming\" is a poignant and compelling love story that will leave readers deeply moved and rooting for the enduring power of love amidst life\'s storms.', 'love');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('1-357-91357-8', 'Vintage Book', , '2023-03-07', 'Agatha Christie', 'Amidst the deafening roar of cannons and the cries of anguish, the war rages on, devouring the lives of the brave and innocent alike. Brothers turned foes, nations locked in a relentless struggle, each battle writes a tale of devastation and sacrifice. Soldiers march with trepidation, carrying the weight of their nations\' aspirations on their shoulders. In the wake of conflict, cities crumble, and families are torn asunder, leaving scars that may never heal. Diplomacy falters, and darkness eclipses hope as the war\'s insatiable appetite for destruction persists. Yet amidst the chaos, the indomitable human spirit prevails, forging bonds of camaraderie that defy the bloodshed. The echoes of fallen heroes and the longing for peace permeate the battlefields, serving as reminders of the true cost of war.', 'historical');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('1-357-91357-9', 'A Soul', , '2014-03-11', 'Mark Twain', 'A soul, an intangible essence, dwells within each living being, embodying the essence of life and consciousness. It\'s the core of our existence, the unseen force that breathes vitality into our mortal frames. Bound by neither time nor space, the soul journeys through lifetimes, carrying the wisdom of the ages. It\'s the source of emotions, love, and empathy that connect us all. A soul\'s journey is a tapestry of experiences, shaped by joys and sorrows, triumphs, and tribulations. It seeks purpose and meaning, yearning to unravel the mysteries of existence. As we walk this earthly path, our souls strive to find harmony and enlightenment, embracing the beauty and complexity of being alive. Ultimately, it\'s the legacy of our souls that lives on, leaving an indelible mark on the fabric of eternity.', 'historical');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('1-6515-4854-3', 'The lord of the Lost', , '2018-09-12', 'J.R.R. Tolkien', '\"The Lord of the Lost\" is an eerie and unsettling horror novel that takes readers on a nightmarish journey into the depths of darkness. Set in a desolate and haunted mansion, the story follows a group of unsuspecting individuals who find themselves trapped by an enigmatic and malevolent force. As they confront their deepest fears and past traumas, the mansion\'s dark secrets begin to unravel, revealing a sinister presence that feeds on their deepest insecurities. The author\'s skillful storytelling creates a chilling and claustrophobic atmosphere, making readers feel as though they are experiencing the horrors firsthand. With its clever plot twists and relentless sense of dread, \"The Lord of the Lost\" is a spine-tingling page-turner that will keep readers awake long into the night. This chilling tale is a must-read for horror enthusiasts who crave a masterfully crafted and hauntingly immersive experience.', 'horror');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('2-468-13579-1', 'Find the Lady', , '2023-07-12', 'J.K. Rowling', 'In the bustling streets of a quaint town square, a crowd gathers, eager to witness the age-old game of \"Find the Lady.\" With nimble hands and a cunning smile, the dealer shuffles the three cards, defying even the sharpest eyes. The lady, a red queen, hides among the cards, challenging onlookers to discern her elusive position. Sleight of hand and misdirection play their part as the dealer effortlessly swaps the cards, leaving participants bewildered. Bets are placed, hearts race, and anticipation fills the air. But the lady remains elusive, vanishing and reappearing at the whims of the skilled manipulator. In the end, the crowd disperses, some triumphant in their discoveries, others humbled by their inability to find the lady amidst the sleight of hand mastery.', 'historical');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('2-718-28182-8', 'The King of an empire', , '2015-03-10', 'Virginia Woolf', 'The King of a vast empire stands at the pinnacle of authority, ruling with an iron fist and commanding unwavering loyalty from his subjects. Cloaked in regal attire, he embodies majesty and power, revered as the embodiment of the nation\'s strength and unity. With sagacious counsel from advisors, he navigates the complexities of governance and diplomacy, ensuring the prosperity of his realm. On the battlefield, he leads his armies with valor and tactical brilliance, securing victories and expanding the empire\'s borders. Though burdened by the weight of his responsibilities, he remains resolute in his commitment to the welfare of his people. Celebrated and feared, his name echoes throughout history, leaving an indelible mark as a great ruler of an illustrious empire. Yet, the throne can be a precarious place, as he must constantly guard against internal strife and external threats that seek to challenge his reign.', 'historical');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('3-141-59265-3', 'The Last Pharaoh', , '2023-07-12', 'F. Scott Fitzgerald', '\"The Last Pharaoh\" refers to Cleopatra VII, the final ruler of ancient Egypt. With a legacy that transcends time, she was a captivating and influential figure in history. Known for her intelligence, charm, and strategic acumen, Cleopatra navigated the tumultuous political landscape of her era, forging alliances with influential Romans like Julius Caesar and Mark Antony to preserve Egypt\'s sovereignty. Her captivating allure and charisma left a profound impact on her contemporaries, leaving an indelible mark on the annals of ancient history. However, her reign came to an end with the fall of Alexandria to Octavian\'s forces in 30 BCE, marking the end of the Ptolemaic dynasty and the end of Egypt\'s independence. Despite her tragic end, Cleopatra\'s legacy as the Last Pharaoh lives on as a symbol of a remarkable woman who wielded power and influence in a world dominated by men.', 'historical');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('3-3456-5465-8', 'Dream Machina', , '2014-05-06', 'Toni Morrison', '\"Dream Machina\" is a captivating work of fiction that ventures into the realms of science fiction and psychological thriller. The book follows the protagonist\'s journey through a world where dreams are engineered, leading to a gripping exploration of the human mind and consciousness. The author\'s imaginative storytelling and intricate world-building create a vivid and immersive reading experience. With its clever plot twists and suspenseful narrative, \"Dream Machina\" keeps readers engrossed until the very end. Themes of identity, ethics, and the consequences of tampering with reality are skillfully explored, provoking thought and contemplation. This mind-bending and enthralling novel is a must-read for sci-fi enthusiasts and those who enjoy psychological thrillers, offering an intellectually stimulating and emotionally charged adventure. \"Dream Machina\" is a testament to the power of imagination and the intricacies of the human psyche.', 'fiction');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('3-4856-0056-2', 'See me Deep Forest', , '2019-06-11', 'Jo Beverley', '\"See Me Deep Forest\" is a mesmerizing and enchanting love story that takes readers on an evocative journey through the mystical depths of nature. Set in a lush and magical forest, the book follows the captivating romance between two souls connected by an inexplicable bond. The author\'s vivid descriptions paint a breathtaking picture of the forest\'s beauty, making it a character in its own right. As the protagonists\' love unfolds amidst the whispering trees and dancing leaves, readers are transported into a world of wonder and romance. With its lyrical prose and soul-stirring emotions, \"See Me Deep Forest\" delves into themes of connection, healing, and the power of love to transcend boundaries. This heartwarming and immersive novel is a celebration of love\'s ability to heal and inspire, leaving readers with a profound sense of awe and a longing to explore the depths of their own hearts. \"See Me Deep Forest\" is a captivating and unforgettable read that resonates long after the last page is turned.', 'love');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('4-2546-0456-0', 'LAST', , '2017-02-22', 'Jojo Moyes', '\"LAST\" is an emotionally charged love story that grips readers with its raw intensity and profound depth. Set in the backdrop of a world on the brink of catastrophe, the book follows the poignant romance between two individuals facing their own mortality. The author\'s poignant prose captures the complexities of love, loss, and resilience, making it a powerful and unforgettable read. Amidst the chaos, the protagonists find solace and hope in each other\'s arms, creating an unbreakable bond that transcends time. With every page, readers are taken on an emotional rollercoaster, experiencing the highs and lows of the characters\' journey. \"LAST\" is a love story that leaves a lasting impact, reminding us of the preciousness of life and the transformative power of love, even in the face of adversity. This beautifully crafted novel is an emotional tour de force that will stay with readers long after they\'ve turned the final page.', 'love');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('4-4562-6285-9', 'Memory', , '2015-09-10', 'Agatha Christie', '\"Memory\" is a deeply moving and thought-provoking book that explores the complexities of human recollections. Written with poignant prose and emotional depth, the author delves into the fragility of memory and its impact on one\'s sense of self. The book follows the protagonist\'s journey to unravel the mysteries of her past, unearthing buried memories that shape her identity. With vivid descriptions and powerful storytelling, \"Memory\" immerses readers in a world of introspection and self-discovery. Themes of love, loss, and resilience are expertly woven into the narrative, resonating with readers on a profound level. As the pages turn, \"Memory\" prompts introspection about the nature of memories and the importance of cherishing the moments that shape our lives. This heartfelt and emotionally charged book leaves a lasting impression, reminding us of the preciousness of memory and the power of human connection.', 'fiction');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('4-6565-4545-0', 'Ice & Fire', , '2015-01-01', 'Isabel Allende', '\"Ice & Fire\" is a spellbinding work of fiction that weaves together the contrasting elements of ice and fire in a mesmerizing tapestry. Set in a land where opposing forces collide, the book follows the enthralling journey of two protagonists whose destinies are inexorably intertwined. With exquisite prose and breathtaking world-building, the author crafts an immersive and captivating narrative that keeps readers engrossed from beginning to end. As the characters navigate through trials and tribulations, themes of power, love, and redemption take center stage, evoking a rollercoaster of emotions. \"Ice & Fire\" is a gripping and emotionally charged tale that blends fantasy, adventure, and romance seamlessly, making it a must-read for fans of epic stories with a touch of magic. This enchanting novel leaves readers with a sense of awe and a longing for more from this talented author.', 'fiction');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('5-050-50505-0', 'The kindom of Hella', , '2015-12-09', 'Ernest Hemingway', 'In the mysterious and foreboding Kingdom of Hella, darkness reigns supreme, casting an eternal shadow over the land. Ruled by a enigmatic monarch, the realm is shrouded in ancient myths and eerie folklore, leaving its citizens in perpetual trepidation. Sinister creatures lurk in the depths of haunted forests and desolate moors, adding to the kingdom\'s aura of fear. The chilling winds seem to carry whispers of long-forgotten tales, while the moon shines ominously upon the decrepit castles that dot the landscape. Yet, amidst the gloom, there lies an undeniable allure to the Kingdom of Hella, drawing adventurers and seekers of the supernatural to unlock its secrets. But one must tread carefully, for the price of curiosity may be an encounter with the realm\'s malevolent spirits or a journey into the depths of the unknown.', 'historical');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('5-6895-698-7', 'Torture', , '2022-07-01', 'Neil Gaiman', '\"Torture\" is a chilling horror novel that delivers a spine-tingling and atmospheric experience. Set in a secluded and foreboding forest, the story follows a group of friends who decide to stay in an old, abandoned house for a weekend getaway. As they uncover the house\'s disturbing history, they find themselves trapped in a nightmarish battle against malevolent spirits and ancient curses. The author\'s expert storytelling skillfully builds tension and suspense, keeping readers on the edge of their seats. With its eerie ambiance and hair-raising plot twists, \"House in the Wood\" delves deep into psychological horror, leaving readers questioning the boundaries between reality and the supernatural. This haunting and thrilling novel is a must-read for horror enthusiasts who crave an immersive and unforgettable journey into the macabre.', 'horror');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('6-4518-8546-8', 'My Better Half', , '2016-02-17', 'Mary Balogh', '\"My Better Half\" is a delightful and heartwarming love story that celebrates the magic of soulmate connections. Set in a bustling city, the book follows the endearing journey of two individuals who, despite their differences, complement each other perfectly. The author\'s skillful portrayal of their shared experiences and genuine chemistry creates an irresistibly charming narrative. With moments of humor, tenderness, and vulnerability, \"My Better Half\" tugs at the heartstrings, leaving readers with a renewed belief in true love. As the protagonists navigate the challenges of life, they learn valuable lessons about growth and compromise, making their love story all the more relatable. This heartwarming and uplifting novel is a celebration of love\'s power to heal, inspire, and bring out the best in each other. \"My Better Half\" is a touching and feel-good read that leaves readers with a smile and a warm sense of hope for the enduring power of love.', 'love');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('6-4854-3546-1', 'Love', , '2016-10-13', 'Colleen Hoover', '\"Love\" is a transcendent anthology that celebrates the myriad facets of the most powerful emotion. Comprising diverse stories, poems, and reflections, this book beautifully captures the essence of love in all its forms - romantic, familial, platonic, and self-love. The authors\' evocative prose and heartfelt expressions resonate deeply with readers, inviting them to reflect on their own experiences and connections. With each piece, \"Love\" illuminates the joys, complexities, and vulnerabilities that come with embracing love\'s transformative power. The anthology explores the universality of love, crossing cultural and societal boundaries, making it a heartwarming and inclusive read. \"Love\" is a treasure trove of emotions, leaving readers with a renewed appreciation for the beauty and depth of this extraordinary human experience. This enchanting collection is a testament to the timeless and unyielding force that binds us all - love in all its glorious splendor.', 'love');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('7-2568-689-0', 'House in the Wood', , '2018-03-13', 'J.D. Salinger', '\"House in the Wood\" is a chilling horror novel that delivers a spine-tingling and atmospheric experience. Set in a secluded and foreboding forest, the story follows a group of friends who decide to stay in an old, abandoned house for a weekend getaway. As they uncover the house\'s disturbing history, they find themselves trapped in a nightmarish battle against malevolent spirits and ancient curses. The author\'s expert storytelling skillfully builds tension and suspense, keeping readers on the edge of their seats. With its eerie ambiance and hair-raising plot twists, \"House in the Wood\" delves deep into psychological horror, leaving readers questioning the boundaries between reality and the supernatural. This haunting and thrilling novel is a must-read for horror enthusiasts who crave an immersive and unforgettable journey into the macabre.', 'horror');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('7-7589-2463-8', 'Summer Love', , '2014-05-13', 'Emily Bronte', '\"Summer Love\" is a delightful and heartwarming love story that captures the essence of romance in a picturesque summer setting. Set against the backdrop of sun-kissed beaches and lazy afternoons, the book follows the blossoming love between two charming protagonists. The author\'s evocative descriptions evoke the joys of summer, making readers feel like they are basking in the warm embrace of the season themselves. As the characters\' love story unfolds, it is filled with tender moments, laughter, and shared adventures, making it impossible not to root for their happiness. \"Summer Love\" is a feel-good read that reminds us of the magic and excitement that love brings, especially in the carefree days of summer. With its genuine and relatable characters, this heartwarming novel leaves readers with a smile on their faces and a renewed belief in the power of summer romance.', 'love');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('8-4846-0245-7', 'Marie\'s Secret', , '2016-09-08', 'E.L. James', '\"Marie\'s Secret\" is a captivating love story that unravels the mysteries of the heart and the past. Set in a charming town with an air of nostalgia, the book follows the enchanting journey of Marie as she discovers a hidden family secret that changes the course of her life. The author\'s skillful storytelling weaves together romance, history, and secrets, keeping readers engrossed in the plot. With its evocative descriptions and endearing characters, \"Marie\'s Secret\" creates an immersive reading experience that tugs at the heartstrings. As Marie delves into her family\'s past, she also finds herself entangled in a tender romance that adds layers of warmth and emotion to the narrative. This heartwarming and intriguing novel is a delightful exploration of love, history, and the transformative power of uncovering one\'s own truth. \"Marie\'s Secret\" is a heartfelt and satisfying read that leaves readers with a sense of fulfillment and a renewed belief in the resilience of love.', 'love');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('8-6459-3578-1', 'Labyrinth', , '2023-03-20', 'Nora Roberts', '\"Labyrinth\" is a mesmerizing love story that entwines romance and fantasy into an enchanting tale. Set in a mystical world of magic and wonder, the book follows the captivating journey of two souls drawn together by fate. Amidst the labyrinth of challenges and obstacles, the protagonists\' love shines like a guiding light, illuminating their path. The author\'s lyrical prose and vivid descriptions create an immersive and otherworldly ambiance, allowing readers to be swept away by the enchanting setting. As the characters navigate through trials and tribulations, their bond deepens, evoking a sense of hope and warmth. Throughout \"Labyrinth,\" the underlying theme of love\'s transformative power resonates strongly, leaving readers with a profound belief in the strength of love\'s enduring magic. This captivating and ethereal love story is an emotional and unforgettable journey that will linger in the hearts of readers long after the final page.', 'love');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('9-876-54321-0', 'Spartan One', , '2017-10-11', 'Nikolus', 'Spartan One, a formidable force on the battlefield, stands as a testament to the indomitable spirit of the ancient warriors from Sparta. From a young age, he was molded and honed to become a fierce and disciplined combatant. Enduring rigorous training and trials, he emerged as a symbol of unwavering courage and unparalleled valor. With a chiseled physique and a resolute gaze, he fearlessly marches into the heart of chaos, undeterred by the perils that lie ahead. His unwavering dedication to duty and the camaraderie of his fellow Spartans fuel his determination to triumph over any adversary. Through countless battles, he has proved his mettle, a warrior unmatched in both skill and spirit. In the face of danger, Spartan One remains unyielding, embodying the essence of the Spartan legacy and leaving a lasting mark in the annals of history.', 'historical');
INSERT INTO `book` (`ISBN`, `Title`, `Image`, `Publication_Date`, `Author`, `Review`, `Categories`) VALUES
('9-999-99999-9', 'Secrets OF Light', , '2023-07-04', 'George Orwell', 'In the ethereal realm of \"Secrets of Light,\" luminous mysteries dance through the cosmic expanse, beyond mortal comprehension. It\'s a realm where the essence of illumination holds the answers to the universe\'s enigmas. Within the celestial ballet of shimmering stars, ancient knowledge is inscribed, waiting to be deciphered by those who dare to seek. The radiance of truth illuminates hidden paths, revealing the interconnectedness of all existence. Amidst the celestial symphony, elusive beings of light guard sacred wisdom, sharing glimpses of enlightenment with the worthy. As seekers embark on their quest for understanding, they are tested by the forces of darkness that seek to obscure the truths they seek. Only those who embrace the brilliance of love and wisdom can truly unlock the Secrets of Light, transcending the boundaries of mortal perception.', 'historical');

